import React from 'react'
import Buttons from '../components/Buttons'
import DataFetching from '../components/DataFetching'
import Table from '../components/Table'
import Widget from '../components/Widget'
import { useNavigate } from "react-router-dom";
import ModalForm from '../components/ModalForm'

import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import RenderTablePage from './RenderTablePage';
import AnotherPageComponent from './AnotherPageComponent';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <DisplayTableComponent />
        </Route>
        <Route path="/another-page">
          <AnotherPageComponent />
        </Route>
      </Switch>
    </Router>
  );
};


const Dashboard = () => {
  const navigate = useNavigate()
  return (
   <>
    <Widget />
      <div className='App'>
        <DataFetching url="income_widget"/>
        <DataFetching url="expense_widget"/>
      </div>
      <ModalForm />
      <Buttons label='Expense Chat' handleClick={() => navigate('expense-page')}/>
      <Buttons label='Income Chart' handleClick={() => navigate('income-page')}/>
      <Table/>
   </>
  )
}

export default Dashboard;
